import React from "react";
import {useState} from "react";


function UserPage(){
    const [message, setMessage] = useState('');

    function handleSubmit(e){
        console.log("you click the button");
    }

    const handleChange = event => {
        setMessage(event.target.value);

        console.log('value is:', event.target.value);
      };

    return (
        <div>
            <h1>Hi this is a wildfire prediction</h1>
            <label>County: </label>
            <input 
                type="text" 
                id ="County" 
                name ="County" 
                onChange={handleChange}
                value={message}
                placeholder="Enter County">
                </input>
            <br></br>
            <label>Date: </label>
            <input type="date" name="datetime"></input>
            <br></br>
            <label>Temp: </label>
            <input type="float" name="temp" placeholder="Enter Temp in Celius"></input>
            <br></br>
            <label>Hum: </label>
            <input type="float" name="Hum" placeholder="Enter Hum in %"></input>
            <br></br>
            <button type="button" name= "submit" onClick={handleSubmit}>Sumbit</button>
        </div>
    );
}

export default UserPage;
